export default class App extends React.Component{

  render(){
    return(
      <>
        <div id="wrap-page">

          <img id="background" src="./assets/images/interface/background_dever.png" loading="lazy" alt="background" />

          <div id="header">
          <img id="background" src="./assets/images/interface/background_dever.png" loading="lazy" alt="background" />

          </div>

        </div>
      </>
    )
  }
}
